import React from "react";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";

import { makeStyles } from "@material-ui/core/styles";
import Box from "@material-ui/core/Box";
import Card from "@material-ui/core/Card";
import CardHeader from "@material-ui/core/CardHeader";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";

import { selectClassificados } from "../../redux/classificado/classificado.selectors";

const ClassificadoCounter = ({ classificados }) => {
  return (
    <Box mb={2}>
      <Card>
        <CardHeader>{classificados.classificados}</CardHeader>
      </Card>
    </Box>
  );
};

const mapStateToProps = createStructuredSelector({
  classificados: selectClassificados,
});

export default connect(mapStateToProps)(ClassificadoCounter);
